/* ==UserStyle==
@name Advent Of Code Catppuccin
@namespace github.com/catppuccin/userstyles/styles/advent-of-code
@homepageURL https://github.com/catppuccin/userstyles/tree/main/styles/advent-of-code
@version 2024.12.31
@updateURL https://github.com/catppuccin/userstyles/raw/main/styles/advent-of-code/catppuccin.user.less
@supportURL https://github.com/catppuccin/userstyles/issues?q=is%3Aopen+is%3Aissue+label%3Aadvent-of-code
@description Soothing pastel theme for Advent Of Code
@author Catppuccin
@license MIT

@preprocessor less
@var select lightFlavor "Light Flavor" ["latte:Latte*", "frappe:Frappé", "macchiato:Macchiato", "mocha:Mocha"]
@var select darkFlavor "Dark Flavor" ["latte:Latte", "frappe:Frappé", "macchiato:Macchiato", "mocha:Mocha*"]
@var select accentColor "Accent" ["rosewater:Rosewater", "flamingo:Flamingo", "pink:Pink", "mauve:Mauve*", "red:Red", "maroon:Maroon", "peach:Peach", "yellow:Yellow", "green:Green", "teal:Teal", "blue:Blue", "sapphire:Sapphire", "sky:Sky", "lavender:Lavender", "subtext0:Gray"]
==/UserStyle== */

@-moz-document domain("adventofcode.com") {
  :root {
    @media (prefers-color-scheme: light) {
      #catppuccin(@lightFlavor);
    }
    @media (prefers-color-scheme: dark) {
      #catppuccin(@darkFlavor);
    }
  }

  #catppuccin(@flavor) {
    @rosewater: @catppuccin[@@flavor][@rosewater];
    @flamingo: @catppuccin[@@flavor][@flamingo];
    @pink: @catppuccin[@@flavor][@pink];
    @mauve: @catppuccin[@@flavor][@mauve];
    @red: @catppuccin[@@flavor][@red];
    @maroon: @catppuccin[@@flavor][@maroon];
    @peach: @catppuccin[@@flavor][@peach];
    @yellow: @catppuccin[@@flavor][@yellow];
    @green: @catppuccin[@@flavor][@green];
    @teal: @catppuccin[@@flavor][@teal];
    @sky: @catppuccin[@@flavor][@sky];
    @sapphire: @catppuccin[@@flavor][@sapphire];
    @blue: @catppuccin[@@flavor][@blue];
    @lavender: @catppuccin[@@flavor][@lavender];
    @text: @catppuccin[@@flavor][@text];
    @subtext1: @catppuccin[@@flavor][@subtext1];
    @subtext0: @catppuccin[@@flavor][@subtext0];
    @overlay2: @catppuccin[@@flavor][@overlay2];
    @overlay1: @catppuccin[@@flavor][@overlay1];
    @overlay0: @catppuccin[@@flavor][@overlay0];
    @surface2: @catppuccin[@@flavor][@surface2];
    @surface1: @catppuccin[@@flavor][@surface1];
    @surface0: @catppuccin[@@flavor][@surface0];
    @base: @catppuccin[@@flavor][@base];
    @mantle: @catppuccin[@@flavor][@mantle];
    @crust: @catppuccin[@@flavor][@crust];
    @accent: @catppuccin[@@flavor][@@accentColor];

    color-scheme: if(@flavor = latte, light, dark);

    ::selection {
      background-color: fade(@accent, 30%);
    }

    input,
    textarea {
      &::placeholder {
        color: @subtext0 !important;
      }
    }

    body {
      background: @base;
      color: @text;

      header h1 a,
      header h1 span {
        color: @green;
        text-shadow: 0 0 2px @green, 0 0 5px @green;
      }

      a {
        color: @green;
      }

      .star-count {
        color: @yellow;
      }

      .quiet {
        color: @subtext0;
        opacity: 1;
      }

      .share,
      .share:hover,
      input[type="submit"] {
        color: @green;
      }

      main {
        article {
          em {
            color: @text;
            text-shadow: 0 0 5px @text;
          }

          h2 {
            color: @text;
          }

          input[type="radio"]:checked ~ span,
          input[type="checkbox"]:checked ~ span {
            color: @text;
          }

          input[type="radio"] ~ span:hover,
          input[type="radio"] ~ span:focus,
          input[type="checkbox"]:hover ~ span,
          input[type="checkbox"]:focus ~ span {
            background-color: @crust;
          }
        }
        .supporter-badge {
          color: @yellow;
        }

        .supporter-badge:hover {
          color: @yellow;
          text-shadow: 0 0 5px @yellow;
        }

        .sponsor-badge {
          color: @blue;
        }

        .sponsor-badge:hover,
        .sponsor-badge:focus {
          color: @blue;
          text-shadow: 0 0 5px @blue;
        }

        .leaderboard-entry {
          .leaderboard-position {
            color: @subtext1;
          }
          .leaderboard-totalscore {
            color: @text;
          }
        }

        .leaderboard-daylinks-selected {
          color: @text;
          text-shadow: 0 0 5px @text;
        }

        .leaderboard-daylinks-selected:hover {
          color: @green;
        }

        .leaderboard-anon {
          opacity: 1;
          color: @subtext0;
        }
        .calendar {
          .calendar-color-w {
            color: @text;
          }
          .calendar-color-s {
            color: @yellow;
          }
          .calendar-color-c {
            color: @subtext1;
          }
          .calendar-color-g3 {
            color: darken(@green, 3%);
          }
          .calendar-color-g2 {
            color: @green;
          }
          .calendar-color-g4 {
            color: darken(@green, 3.5%);
          }
          .calendar-color-u {
            color: @sky;
          }
          .calendar-color-a {
            color: @subtext0;
          }
          .calendar-color-g1 {
            color: darken(@green, 2.5%);
          }
          .calendar-color-g0 {
            color: darken(@green, 2%);
          }
          .calendar-color-l {
            color: @red;
          }
          .calendar-mark-complete {
            color: @yellow;
          }
          .calendar-mark-verycomplete {
            color: @yellow;
          }
          .calendar-day {
            color: @subtext1;
          }
          #calendar-countdown {
            color: @subtext1;
          }

          span {
            color: @surface0;
          }

          a {
            color: @surface2;
          }
        }

        .day-success {
          color: @yellow;
          text-shadow: 0 0 5px @yellow;
        }

        .stats-both {
          color: @yellow;
        }

        .stats-firstonly {
          color: @overlay0;
        }

        a:hover {
          background-color: @mantle !important;
        }

        input[type="text"],
        textarea,
        code::before {
          border-color: @surface0;
          background: @crust;
        }
      }
    }
  }
}

