        input,
        textarea {
            &::placeholder {
                color: @subtext0 !important;
            }
        }

        svg.logo {
            @accentH: hue(@accent);
            @protonH: hue(#6d4aff);

            .replaceColor(@org, @property) {
                &[@{property}="@{org}"] {
                    @hDiff: @protonH - hue(@org);
                    @{property}: hsl( @accentH - @hDiff,
                    saturation(@org) - 30%,
                    lightness(@org));
                }
            }

            /* deno-fmt-ignore */
            > path {
                .replaceColor(#B8D7FF, fill);
                .replaceColor(#8F69FF, fill);
