        @surface0: @catppuccin[@@flavor][@surface0];
        @base: @catppuccin[@@flavor][@base];
        @mantle: @catppuccin[@@flavor][@mantle];
        @crust: @catppuccin[@@flavor][@crust];
        @accent: @catppuccin[@@flavor][@@accentColor];

        --ctp-rosewater: @rosewater;
        --ctp-flamingo: @flamingo;
        --ctp-pink: @pink;
        --ctp-mauve: @mauve;
        --ctp-red: @red;
        --ctp-maroon: @maroon;
        --ctp-peach: @peach;
        --ctp-yellow: @yellow;
        --ctp-green: @green;
        --ctp-teal: @teal;
        --ctp-sky: @sky;
        --ctp-sapphire: @sapphire;
        --ctp-blue: @blue;
        --ctp-lavender: @lavender;
        --ctp-text: @text;
        --ctp-subtext1: @subtext1;
        --ctp-subtext0: @subtext0;
        --ctp-overlay2: @overlay2;
        --ctp-overlay1: @overlay1;
        --ctp-overlay0: @overlay0;
        --ctp-surface2: @surface2;
        --ctp-surface1: @surface1;
        --ctp-surface0: @surface0;
        --ctp-base: @base;
        --ctp-mantle: @mantle;
        --ctp-crust: @crust;

        color-scheme: if(@flavor =latte, light, dark);

        ::selection {
            background-color: fade(@accent, 30%);
        }

        input,
        textarea {
            &::placeholder {
                color: @subtext0 !important;
            }
        }

        .highlight {
            background-color: @mantle;

            pre {
                background-color: @mantle !important;
            }
        }

        &:not(.dark,
        .light) {
            p {
                color: @subtext0 !important;
            }

            span {
                color: @text;
            }
        }

        .share {
            background-color: @mantle;
            border-color: @crust;

            &:hover {
                background-color: @surface0;
            }
        }

        .theme-choice button {
            color: @text;
            background-color: @mantle;
            border-color: @crust;

            &:hover {
                background-color: @surface0;
            }
        }

        #lang-select {
            color: @text;
            background-color: @mantle;
            border-color: @crust;
        }

        td.lang span a {
            color: @text;
            background-color: @mantle;
            border-color: @crust;

            &:hover {
                background-color: @surface0;
            }
        }

        &,
        body {
            background-color: @base;
            color: @text;
            border-color: @base;
            box-shadow: none;
        }

        td,
        th {
            color: @text;
            border-bottom-color: @surface0;
        }

        footer {
            p {
                color: @subtext1;
            }
        }

        a {
            color: @accent !important;

            code {
                color: @accent !important;
            }

            &:visited {
                color: darken(@accent, 5%) !important;
            }

            &.active {
                color: @base !important;
                background-color: @accent !important;
                border-color: darken(@accent, 15%) !important;

                &:visited {
                    background-color: darken(@accent, 5%) !important;
                    color: @base !important;
                    border-color: darken(@accent, 10%) !important;
                }
            }
        }

        hr {
            border-color: @surface1;
        }

        code {
            background-color: @mantle;
            color: @text;
        }
    }
